svg.script:
var g_element;
var SVGDoc;
var SVGRoot;
function RunScript(LoadEvent) {
	top.SVGsetDimension	= setDimension;
	top.SVGsetScale		= setScale;
	SVGDoc			= LoadEvent.target.ownerDocument;
	g_element		= SVGDoc.getElementById("layer1");
}

function setDimension(w,h) {
	SVGDoc.documentElement.setAttribute("width", w);
	SVGDoc.documentElement.setAttribute("height", h);
}

function setScale(sw, sh) {
	g_element.setAttribute("transform", "scale(" + sw + " " + sh +")");
}

var timerID = null;
var timerRunning = false;
var show = true;

function stopclock(){
    if(timerRunning)
    clearInterval(timerID)
    timerRunning = false
}

function startclock(){
    // Make sure the clock is stopped
    stopclock()
    timerID = setInterval("showtime()",1000)
    timerRunning = true
}

function showtime(){ 
	if(show == true){
		var paramArray = [];
        	if ( document.defaultView.frameElement ) {
			var params = document.defaultView.frameElement.getElementsByTagName("param");

           		for ( var i = 0, iLen = params.length; iLen > i; i++ ) {
				var eachParam = params[ i ];
				var name = eachParam.getAttribute( "name" );
				var value = eachParam.getAttribute( "alternative" );

				paramArray[ name ] = value;

				var district = document.getElementById(name);
				district.style.cssText = "fill-opacity: 1; stroke: rgb(0, 0, 0); stroke-opacity: 1; fill:  " + value + ";";
			}
		}
		show = false;
	} else {
		var paramArray = [];
        	if ( document.defaultView.frameElement ) {
			var params = document.defaultView.frameElement.getElementsByTagName("param");

           		for ( var i = 0, iLen = params.length; iLen > i; i++ ) {
				var eachParam = params[ i ];
				var name = eachParam.getAttribute( "name" );
				var value = eachParam.getAttribute( "value" );

				paramArray[ name ] = value;

				var district = document.getElementById(name);
				district.style.cssText = "fill-opacity: 1; stroke: rgb(0, 0, 0); stroke-opacity: 1; fill: " + value + ";";				
			}
		}

		show = true;
	}
}

	function SetParams() {
		startclock();
		var paramArray = [];
        	if ( document.defaultView.frameElement ) {
			var params = document.defaultView.frameElement.getElementsByTagName("param");

           		for ( var i = 0, iLen = params.length; iLen > i; i++ ) {
				var eachParam = params[ i ];
				var name = eachParam.getAttribute( "name" );
				var value = eachParam.getAttribute( "value" );

				paramArray[ name ] = value;

				var district = document.getElementById(name);
				district.style.cssText = "fill-opacity: 1; stroke: rgb(0, 0, 0); stroke-opacity: 1; fill: " + value + ";";
			}
		}

	};
